import CeQuiMeTouche from './CeQuiMeTouche';

const CvSlider = () => (
  <Slider dots>
    <div>
      <Pourquoi/>
    </div>
    <div>
      <EtAvant/>
    </div>
    <div>
      <CeQueJaime/>
    </div>
    <CeQuiMeTouche/>
    <div>
      <h3>5</h3>
    </div>
  </Slider>
);

export default CvSlider;
